class Net(nn.Module):
    def __init__(self):
        super().__init__()
        self.conv1 = nn.Conv2d(3, 6, 5)
        self.pool = nn.MaxPool2d(2, 2)
        self.conv2 = nn.Conv2d(6, 16, 5)
        self.fc1 = nn.Linear(16 * 22 * 22, 120)
        self.fc2 = nn.Linear(120, 84)
        self.fc3 = nn.Linear(84, 10)

    def forward(self, x):
        x = self.pool(F.relu(self.conv1(x)))
        x = self.pool(F.relu(self.conv2(x)))
        x = torch.flatten(x, 1) # flatten all dimensions except batch
        x = F.relu(self.fc1(x))
        x = F.relu(self.fc2(x))
        x = self.fc3(x)
        return x

def split_image_into_grid(original_image, rows, cols):
    width, height = original_image.size
    cell_width = width // cols
    cell_height = height // rows

    to_return = []
    for row in range(rows):
        for col in range(cols):
            left = col * cell_width
            top = row * cell_height
            right = left + cell_width
            bottom = top + cell_height
            cell_image = original_image.crop((left, top, right, bottom))
            to_return.append(cell_image)
    return to_return

def call_model(net, transform, what_image):
    with torch.no_grad():
        transformed = transform(what_image).unsqueeze(0)
        print(transformed.shape)
        outputs = net(transformed)
        _, predictions = torch.max(outputs, 1)
        # collect the correct predictions for each class
        print(predictions)
